function createNewUser(){let n={username:document.getElementById("new-username").value,email:document.getElementById("new-email").value,password:document.getElementById("new-password").value,isAdmininater:document.getElementById("new-admininater").value};$.ajax({url:"/CreateNewUser",type:"POST",dataType:"html",data:n,success:function(n){n?(searchUser(),$("#add-user-modal").modal("hide")):(searchUser(),$("#add-user-modal").modal("hide"),alert("Save did not work"))},error:function(){}})}